// src/components/MRIForm.js
import React, { useState } from 'react';
import DatePicker from 'react-datepicker';
import 'react-datepicker/dist/react-datepicker.css';
import { useLocation } from 'react-router-dom';
import emailjs from 'emailjs-com';
import '../styles/bookform.css';

const MRIForm = () => {
  const location = useLocation();
  const { service } = location.state || { service: '' };

  const [startDate, setStartDate] = useState(new Date());
  const [time, setTime] = useState('');
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    phone: '',
    message: ''
  });

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    const templateParams = {
      ...formData,
      date: startDate.toLocaleDateString(),
      time: time,
      service: service
    };

    emailjs.send('service_t43b9l3', 'template_nhom3d2', templateParams, 'jpDNG96sg4J956g8G')
      .then((result) => {
        console.log(result.text);
      }, (error) => {
        console.log(error.text);
      });

    // Reset form
    setFormData({ name: '', email: '', phone: '', message: '' });
    setStartDate(new Date());
    setTime('');
  };

  return (
    <form onSubmit={handleSubmit}>
      <div>
        <label>Service:</label>
        <input type="text" name="service" value={service} readOnly />
      </div>
      <div>
        <label>Name:</label>
        <input type="text" name="name" value={formData.name} onChange={handleChange} required />
      </div>
      <div>
        <label>Email:</label>
        <input type="email" name="email" value={formData.email} onChange={handleChange} required />
      </div>
      <div>
        <label>Phone:</label>
        <input type="tel" name="phone" value={formData.phone} onChange={handleChange} required />
      </div>
      <div>
        <label>Message:</label>
        <textarea name="message" value={formData.message} onChange={handleChange} required />
      </div>
      <div>
        <label>Date:</label>
        <DatePicker selected={startDate} onChange={date => setStartDate(date)} required />
      </div>
      <div>
        <label>Time:</label>
        <select value={time} onChange={e => setTime(e.target.value)} required>
          <option value="">Select Time</option>
          <option value="9:00 AM">9:00 AM</option>
          <option value="10:00 AM">10:00 AM</option>
          <option value="11:00 AM">11:00 AM</option>
          <option value="12:00 PM">12:00 PM</option>
          <option value="1:00 PM">1:00 PM</option>
          <option value="2:00 PM">2:00 PM</option>
          <option value="3:00 PM">3:00 PM</option>
          <option value="4:00 PM">4:00 PM</option>
        </select>
      </div>
      <div>
        <button type="submit">Submit</button>
      </div>
    </form>
  );
};

export default MRIForm;
